import React from 'react';
import '../styles.css'
import logo from '../logo.svg'
import { Toolbar, Link } from '@material-ui/core';

export default class NavBar extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      active: "Home",
    }
  }

  render() {
    return(
      <div>
        <Toolbar className="Navbar">
            {this.props.sections.map((section) => (
              <Link
                key={section.title}
                href={`./Test`}
                className="NavItem"
              >
                {section.title}
              </Link>
            ))}
        </Toolbar>
      </div>
    );
  }
}
